import React, { Component } from "react";
import { Link as Links } from "react-router-dom";
import { HashLink as Link } from 'react-router-hash-link'

class Header extends Component {
    constructor(props){
        super(props)
        this.state = {
            page:0
        }
    }
    render() {
        return (
            <header>
                <div className="container-m">
                    <div className="fd1">
                        <ul>
                            <li id="logo">SIGEN</li>
                            <li> <Links to='/'>Home</Links> </li>
                            <li> <Link to='#second' smooth={true}> Ferramentas </Link></li>
                            <li>Contato</li>
                            <li style={{ marginRight: '0' }}>Sobre</li>

                        </ul>
                    </div>
                    <div className="fd2">
                        <button className="btn1">Registrar</button>
                        <button className="btn2">Log In</button>

                    </div>

                </div>
            </header>
        )
    }
}
export default Header
